import { styled } from 'styled-components'

const StyledInput = styled.section`
  background-color: #233945;
  width: 80%;
  color: #FFFFFF;
  box-sizing: border-box;
  height: 60%;
  overflow: hidden;
  display: flex;
  flex-direction: column;
`

const StyledTitle = styled.div`
  border: 2px 1px 1px 2px solid #345363;
  padding: 10px;
`

const StyledText = styled.div`
  border: 2px 1px 1px 2px solid #345363;
  padding: 10px;
`

const Textbox = ({ title, text }) => {
  return (
    <>
      <StyledInput>
        <StyledText style={{ fontSize: '2em', fontWeight: 'bold', }}>{title}</StyledText>
        <StyledText style={{ fontSize: '1.8em'}}>{text}</StyledText>
      </StyledInput>
    </>
  )
}

export default Textbox
